import React from "react";
import Header from "./components/Header";
import Card from "./components/Card";
import Footer from "./components/Footer";
import naruto from "./components/naruto.png";
import sasuke from "./components/sasuke.png";
import kakashi from "./components/kakashi.png";
import yahiko from "./components/yahiko.png";
import itachi from "./components/itachi.png";
import obito from "./components/obito.png";
import jiraya from "./components/jiraya.jpg";
import gaara from "./components/gaara.jpg";
import madara from "./components/madara.jpg";
import tsunade from "./components/tsunade.png";
import minato from "./components/minato.jpg";
import oroshimaru from "./components/oroshimaru.jpg";

function App() {
  return (
    <div className="h-screen w-screen bg-slate-900 font-roboto">
      {/* Header */}
      <Header />

      {/* Card Section */}
      <div className="grid gap-4 grid-cols-3 grid-rows-4 sm:grid-cols-6 sm:grid-rows-2 h-[70%] px-10 py-4 mb-14">
        <Card
          bgMainColor={"bg-red-800"}
          bgSecondaryColor={"bg-red-300"}
          cardTitle={"Naruto Uzumaki"}
          myImg={naruto}
        />
        <Card
          bgMainColor={"bg-gray-700"}
          bgSecondaryColor={"bg-gray-600"}
          cardTitle={"Sasuke Uchiwa"}
          myImg={sasuke}
        />
        <Card
          bgMainColor={"bg-zinc-400"}
          bgSecondaryColor={"bg-zinc-300"}
          cardTitle={"Kakashi Hatake"}
          myImg={kakashi}
        />
        <Card
          bgMainColor={"bg-orange-400"}
          bgSecondaryColor={"bg-orange-300"}
          cardTitle={"Yahiko Uzumaki"}
          myImg={yahiko}
        />
        <Card
          bgMainColor={"bg-sky-700"}
          bgSecondaryColor={"bg-sky-300"}
          cardTitle={"Itachi Uchiwa"}
          myImg={itachi}
        />
        <Card
          bgMainColor={"bg-stone-900"}
          bgSecondaryColor={"bg-stone-500"}
          cardTitle={"Obito Uchiwa"}
          myImg={obito}
        />
        <Card
          bgMainColor={"bg-emerald-800"}
          bgSecondaryColor={"bg-emerald-400"}
          cardTitle={"Jiraya of the Sannin"}
          myImg={jiraya}
        />
        <Card
          bgMainColor={"bg-amber-900"}
          bgSecondaryColor={"bg-amber-600"}
          cardTitle={"Gaara of the Sand"}
          myImg={gaara}
        />
        <Card
          bgMainColor={"bg-fuchsia-800"}
          bgSecondaryColor={"bg-fuchsia-400"}
          cardTitle={"Madara Uchiwa"}
          myImg={madara}
        />
        <Card
          bgMainColor={"bg-teal-800"}
          bgSecondaryColor={"bg-teal-500"}
          cardTitle={"Tsunade Senju"}
          myImg={tsunade}
        />
        <Card
          bgMainColor={"bg-yellow-500"}
          bgSecondaryColor={"bg-yellow-200"}
          cardTitle={"Minato Namikaze"}
          myImg={minato}
        />
        <Card
          bgMainColor={"bg-red-600"}
          bgSecondaryColor={"bg-red-300"}
          cardTitle={"Oroshimaru of the Sannin"}
          myImg={oroshimaru}
        />
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
}

export default App;
